$('.caseStudies .openBlock').click(function(event){event.stopPropagation();if($(".item.animating").length>0){return false;}
i=$(this).parents('.item').attr("rel");/*change this test*/if(i==4)i=2;actSlider=$(this).parents('.item').find('.video-bar .slides');item=$(this).parents('.item');if(item.hasClass('open')&&$(this).hasClass('button')){closeBlock(item,i);}else if(!item.hasClass("open")){openBlock(item,i)}});

function closeBlock(item,i){
	//item.find($(".videoWrap")).unbind();
	/**
	 * bane94: unbind is not needed! it causes slide to hide on click
	 * bane94: we do not to hide this on close we close it on open()
	 * this code is not needed as it creates error in case of menu closing
	 *	#commited by hector09
	 */
	 if(item.find("a[title=Stop]").length>0)item.find("a[title=Stop]").trigger("click");
	$('.lights-out').addClass('off');
	item.addClass("beforeclose");
	item.find(".block2 .text").fadeOut(600);
	$(".caseStudies .item.open .block1 .text").fadeOut(600);
	window.setTimeout(function(){item.removeClass("open");},600);
window.setTimeout(function(){item.addClass("close");window.setTimeout(function(){item.removeClass("close beforeclose");$('.lights-out').removeClass('active off');$(".caseStudies .item .block2 .text").fadeIn(400);$(".caseStudies .item .block1 .img").fadeIn(600);$(".caseStudies .block3 .text").fadeIn(1000);$(".caseStudies .item .block1 .text").removeAttr("style");item.find(".videoWrap, .video-bar").hide();item.find(".textBlock2").hide();},500)},2000);bgVideo.play();clearInterval(nextSlide);}



function openBlock(item,i){
	item.find($('.player_bg2')).css('backface-visibility','');
	item.find($('.player_bg1')).css('backface-visibility','');
	item.find(".videoWrap, .video-bar").show().fadeTo(0,0);
	item.find(".texts > div").show().fadeTo(0,0);
	item.addClass('open animating');
	item.find($(".videoWrap")).bind("transitionend webkitTransitionEnd oTransitionEnd MSTransitionEnd",function()
	{
		$(".item.animating").removeClass("animating");
		//$f(vimeoPlayers[i].id).api("play");
		/* 
		 * editted by hector
		 * reason: console error
		 */
		window.setTimeout(function(){item.find($('.player_bg2')).css('backface-visibility','hidden');},800);
		window.setTimeout(function(){item.find($('.player_bg1')).css('backface-visibility','hidden');},800);
		});
	nextSlide=setInterval(function(){nextSlideAnim(actSlider);},8000);$('.lights-out').addClass('active');bgVideo.pause();
	if(item.find("a[title=Play]").length>0)item.find("a[title=Play]").trigger("click");
	if(i!=1)
	{
		item.find('.bane94-slides').slidesjs({
			width: 690,
			height: 397,
			navigation:false
		});
		$(".slidesjs-control ,.slidesjs-container , .bane94-slides").css("height",item.find(".videoWrap").height());
		console.log(item.find(".videoWrap").height() +"height");
	}
	else
	{
		item.find('.bane94-slides').slidesjs({
			width: 690,
			height: 397, 
			play: {
			  active: true,
			  auto: true,
			  interval: 4000,
			  swap: true
			}
		});
	}
		initialize();
	
	}




