$(document).ready(function(){
	$('html, body').animate({scrollTop:2}, 'fast');
	$("#playReel").click(function(){
		document.getElementById('teaser_video').play();
		$("body").css("overflow","hidden");
	});
	$(".closeWrap").click(function(){
		$("body").css("overflow","auto");
	});
	
	$("#teaser_video").css("width","100%");
	$("#teaser_video").css("height" , $(window).height() );
});

/**
 * code to do inner transition to pages
 * smooth fadeIn and fadeOut
 */
function innerpageopen(val){
	forwardflag=1;
	$("#bane94-innerpage .bane94-fullspan .bane94-title").html(" " +val +" ")
	History.pushState({state:1,rand:Math.random()},val, './' +val);
	$('#bane94-innerpage').animate({left:'0'},"slow",function(){
		document.getElementById("bgMusic").muted=true;
		$('body').css('overflow','hidden');
	});
}
function innerpageclose(){
	forwardflag=1;
	History.back();
	$('#bane94-innerpage').animate({left:'-2500px'},"slow",function(){
		document.getElementById("bgMusic").muted=false;
		$('body').css('overflow','auto');
		
	});	
}

function innerpageload(keyword)
{
	
	if(!localStorage[keyword])
	{
		$.ajax({
			url:'data/contentajax.php',
			type:"POST",
			data:{key:keyword},
			success:function(result){
				localStorage[keyword]=result;
				//alert(result);
				innerpageopen(keyword);
				/**
				 * code to hide the loading icon 
				 */
				$(".hector09tmploading").fadeOut();
				$('.bane94_workspace').html(result);
				$("#bane94-innerpage .right .bane94-description").mCustomScrollbar({
						autoHideScrollbar:true,
						theme:"light-thin"
				});
				$(".bane94-gallery").FlowSlider();

				$(".www_FlowSlider_com-branding").remove();
			}
		});
	}
	else
	{
		$('.bane94_workspace').html(localStorage[keyword]);
		/**
		 * code to hide the loading icon 
		 */
		setTimeout(function(){$(".hector09tmploading").hide();},200);
		
		innerpageopen(keyword);
		
		$("#bane94-innerpage .right .bane94-description").mCustomScrollbar({
				autoHideScrollbar:true,
				theme:"light-thin"
		});
		$(".bane94-gallery").FlowSlider();
		$(".www_FlowSlider_com-branding").remove();
	}
}


